import React, { useState } from 'react';

const Restock = () => {
    const [restockItems, setRestockItems] = useState([]);

    const fetchRestockList = async () => {
        try {
            const response = await fetch('/api/inventory/restock'); 
            if (!response.ok) {
                throw new Error(`HTTP error! status: ${response.status}`);
            }
            const data = await response.json();
            setRestockItems(data);
        } catch (error) {
            console.error('Error fetching restock list:', error);
        }
    };

    return (
        <div>
            <button onClick={fetchRestockList}>Fetch Restock List</button>
            <ul>
                {restockItems.map(item => (
                    <li key={item.id}>{item.name} - Quantity: {item.quantity}</li>
                ))}
            </ul>
        </div>
    );
};

export default Restock;
